export default[,
{
    path:'/',
    component: () => import('@/pages/regester'),    
    children:[
        {
          path:'enroll',
          component: () => import('@/components/login'),
        },
    {
        path:'login',
        component: () => import('@/components/login'),   
    }]   
}
]
